import React from 'react'
import Link from 'next/link'
import styled from "styled-components";
import Title from '../Title/title';

const Container = styled.div`
 display: flex;
 width: 100%;
 margin: 0 auto;
 margin-bottom: 40px;
background: ${props => props.isDark ? "white" : "black"};
`

const Menu = styled.div`
 display: flex;
 flex-direction: column;
 width: 100%;
 align-items:center;
 justify-content: center;
 margin: 0 auto;   
`

const List = styled.a`
 font-size: 18px;
 font-weight: 16px;
 cursor: pointer;
 color: ${props => props.isDark ? "black" : "white" };

 &:hover{
   font-weight: bold;
 }
`

function Navbar(props) { 
  return (
    <Container isDark={props.valueDarkMode} handleClik={props.handlebtn} >
      <Menu>
        <Link href="/indonesia">
          <List isDark={props.valueDarkMode} >Indonesia</List>
        </Link>
      </Menu>
      <Title  isDark={props.valueDarkMode}  />
      <Menu>
        <Link href="/global">
          <List isDark={props.valueDarkMode} >Global</List>
        </Link>
      </Menu>
    </Container>
  )
}

export default Navbar;
